#' An Airplane Plot Demonstrating Migration Events
#'
#' @description This function allows for the geographic plotting of clade
#' centers and geographical outliers. Arcs connect clade centers and outliers.
#' This function accepts data from 3 time graphics::points.
#'
#' @param df A data frame of samples containing at least columns:
#'
#' 1. clade: A numeric value. df may have no more than 40 clades with no more
#'    than 50 individual samples per clade.
#'
#' 2. longitude: A numeric value containing the longitudinal coordinate of the
#'    sample's location.
#'
#' 3. latitue: A numeric value containing the latitudinal coordinate of the
#'    sample's location.
#'
#' 4. timepoint: An interger equaling 1, 2, or 3. Representing the time point in
#'    which the sample was taken.
#'
#' @param dfcoor A data frame clade center locations to be plotted containng at
#'least columns:
#' 1. clade: A numeric value reflecting the clade number cooresponding to the
#'    location of the sample. There must be no more or fewer clades than in df.
#'
#' 2. location: A string value containing the location of the center of the
#'    clade.
#'
#' 3. longitude: A numeric value containing the longitudinal coordinate of the
#'    clade center's location.
#'
#' 3. latitude: A numeric value containing the latitudinal coordinate of the
#'    clade center's location.

#' @param time1 A string value conataing the name of the first time point.
#' Example: "January", "December 1-20", "2022".
#' @param time2 A string value conataing the name of the second time point.
#' Example: "January", "December 1-20", "2022".
#' @param time3 A string value conataing the name of the third time point.
#' Example: "January", "December 1-20", "2022".
#'
#' @return Ariplane plot with imposed connections between the clade centers
#' and the geographical outliers of the clade. Clade centers are represented on the
#' mercator projection by larger black dots. Geographic outliers are
#' represented by smaller dots. The arcs indicate a connection between the clade
#' center and the geographic outlier. The color of the arcs indicate the time
#' point that the geographical outlier falls under.
#' @export
#'
#' @examples
#' df <- transRate:: sample_df
#' dfcoor <- transRate:: sample_dfcoor
#' airplane_plot(df,dfcoor,"January","February","March")
#'
airplane_plot <- function(df,dfcoor,time1,time2,time3){
  par(mar=c(0,0,0,0))
  maps::map('world',
            col="#b3b3b3", fill=TRUE, bg="#F1F1F0", lwd=0.05,
            mar=rep(0,4),border=0, ylim=c(-80,80)
  )
  df1 <- subset(df,clade == "1")
  if (is.na(df1$longitude[1]) == FALSE){
    dfcoor1 <- subset(dfcoor,clade == "1")
    dfout1 <- subset(df1,longitude != dfcoor1$longitude[1])
    dfoutplot <- dfout1[!duplicated(dfout1$country),]
    graphics::points(x=dfcoor1$longitude, y=dfcoor1$latitude, col=c("black"), cex=(.7), pch=16)
    graphics::points(x=dfoutplot$longitude, y=dfoutplot$latitude, col=c("black"), cex=(.2), pch=16)
    dfclong <- as.data.frame(dfcoor1$longitude)
    dfclat <- as.data.frame(dfcoor1$latitude)
    dfclong <- as.numeric(dfclong)
    dfclat <- as.numeric(dfclat)
    dflong <- as.data.frame(dfoutplot$longitude)
    dflat <- as.data.frame(dfoutplot$latitude)
    dftime <- as.data.frame(dfoutplot$timepoint)

    if (is.na(dflong[1,]) == FALSE){
      dftimep <- as.numeric(dftime[1,])
      color <- if(dftimep == 1){
        "#1600f7"
      } else if(dftimep == 2){
        "#e30091"
      } else {
        "#d90000"
      }
      dflong1 <- as.numeric(dflong[1,])
      dflat1 <- as.numeric(dflat[1,])
      inter <- geosphere:: gcIntermediate(c(dfclong,dfclat), c(dflong1,dflat1),n=500, addStartEnd=T, breakAtDateLine=F)
      inter <- data.frame(inter)
      graphics::lines(subset(inter,lon>=0),col=c(color), lwd=1.9)
      graphics::lines(subset(inter,lon<0),col=c(color), lwd=1.9)
    }
    if (is.na(dflong[2,]) == FALSE){
